import React from "react";

function Footer() {
  return (
    <footer class="fixed-bottom mt-auto py-3 bg-dark">
      <div class="container">
        <span class="text-muted text-center">SCEHacks - 2021</span>
      </div>
    </footer>
  );
}

export default Footer;
